   "source": [
    "**Description of data source**\n",
    "Data is stored as a csv file in a folder in a long format. There are no issues with bias or credibility in this data as the data is from a primary source who distributed a survey to 30 eligible Fitbit users. The data was measured with the Fitbit hence had no chance of human error. The dataset itself has a usability score of 10.00 and is updated annually to prevent it from being outdated. The dataset is available for free publicly with the CC0: Public Domain License. The data will give me insights into the trends of FitBit users and this will allow me to come to conclusion with my business task. The data had no major problems although the margins of each cells were inconsistent which decreased readability but this was easily rectified."
   ]
  },
