   "source": [
    "**Conclusion**\n",
    "As supported by the first graph, there is a negative correlation between TotalSteps and SedentaryMinutes. This information can be utilised as to inform Bellabeat's Marketing decision. It can be said that not tracking the number of daily steps taken can lead to a more sedentary lifestyle which is a detriment as it is a starting point for diseases. The second graph, shows that there is a positive linear correlation between TotalMinutesAsleep and TotalTimeInBed with some outliers of TotalTimeInBed being higher which is logical. This can be used in Bellabeat's Marketing decision to inform potential customers that the smart device allows you to fall asleep quicker once on bed which will aid physical recovery."
